import React, { Component } from "react";
import Project from "./project";
import { getAllProjects } from "../actions";

class Projects extends Component {
  constructor() {
    super();
    this.state = {
      projectList: []
    };
  }

  handelGet = async () => {
    return await getAllProjects();
  };

  componentDidMount() {
    this.setState({ projectList: this.handelGet() });
    //this.setState({ getAllProjects()})
  }

  render() {
    return <Project projectList={this.state.projectList} />;
  }
}

export default Projects;
